INSERT INTO `taskBook` (`id`, `name`, `email`, `status`, `task`, `image`, `image_name`, `edit`) VALUES
(4, 'Александр', 'iLikePizza@pizza.me', 0, 'Как приготовить тесто для пиццы: рецепт Джейми Оливера\r\nЭтого количества теста хватит на 6-8 блюд. Вы можете использовать все сразу для большой пиццы или лишнее тесто завернуть в пищевую пленку и положить в морозилку.\r\n\r\nИнгредиенты: 1 кг муки высшего сорта (или 800 г муки + 200 г манной крупы), 1 чайная ложка морской соли, 14 г сухих дрожжей, 650 мл теплой воды, 1 столовая ложка сахара, 4 столовых ложки оливкового масла.\r\n\r\nРецепт приготовления теста для пиццы\r\n\r\nВ миске смешайте дрожжи, сахар, масло и воду, оставьте на несколько минут. Просейте муку, смешайте ее с солью и соберите горкой на чистой рабочей поверхности. Сделайте в горке ямку и влейте туда жидкую дрожжевую смесь. Замесите муку, начиная с краев горки. Вымешивайте тесто руками до того времени, пока оно не приобретет гладкую и упругую структуру.\r\n\r\nСкатайте тесто в шар и поместите в миску, покрытую мукой. Сверху тесто тоже присыпьте мукой. Накройте миску влажным полотенцем и оставьте в теплом месте примерно на час: тесто должно увеличиться в два раза.\r\n\r\nЧерез час достаньте тесто, удалите лишнюю муку и помесите еще несколько минут руками.\r\n\r\nРаскатайте тесто или растяните его руками. Примерная толщина основы пиццы – 5 мм. Снова оставьте тесто на 5-10 минут (можно прикрыть пленкой), добавьте соус и начинку и выпекайте.\r\n\r\n\r\nПицца с копченым лососем\r\nИнгредиенты: 1 пласт готового теста, 1 столовая ложка оливкового масла, 1/4 стакана тонко нарезанного красного лука, 1/2 стакана сметаны, пол красной луковицы, сок лайма, 180 г копченого лосося.\r\n\r\nРецепт приготовления пиццы с копченым лососем\r\n\r\nРазогрейте духовку до 230 градусов. Раскатайте тесто и положите его на посыпанную мукой бумагу для выпечки. Выложите на тесто лук и оливковое масло, поставьте пиццу в духовку на 6-8 минут. Выньте и остужайте в течение 5 минут.\r\n\r\nСмешайте сметану с соком лайма и луком. Распределите сметанный крем по пицце, разложите по всей поверхности тонко нарезанный лосось. Можно подавать.', , '4.jpg', '');
