INSERT INTO `taskBook` (`id`, `name`, `email`, `status`, `task`, `image`, `image_name`, `edit`) VALUES
(6, 'Андрей', 'andrei@gmail.com', 0, 'Поехать.\r\nТейде — стратовулкан на острове Тенерифе, с пиковой высотой 3718 метров над уровнем моря, является активным вулканом (действующим), но в настоящее время спящим. Это говорит о том, что на Тенерифе всё ещё могут происходить извержения. Его относительная высота от дна Атлантического океана, составляет 7500 метров. Является самой высокой точкой в этом океане и всей Испании, а также третьим по величине вулканом на Земле от основания (дна), вместе с влк. Мауна-Кеа и влк. Мауна-Лоа на Гавайях.\r\n\r\nВулкан Тейде с Национальным Парком Тейде являются одной природно-охраняемой зоной, объявленной 28 июня 2007 года Объектом Всемирного Наследия - ЮНЕСКО. Помимо того, 31 декабря 2007 года входит в «12 Сокровищ Испании». В настоящее время считается главной достопримечательностью Тенерифе, символом и природным памятником Канарских островов. Им восхищался Колумб, Дарвин и капитан Кук, его обязательно стараются посетить путешественники. Вершина вулкана Тейде величественно возвышается над острвом, ее видно практически с любой его точки. Именно он изображен на гербе Тенерифе и является его символом.\r\nЧто можно увидеть ?\r\n\r\nПоднявшись на высоту 3555 метров, для вас открываются панорамные виды Тенерифе и его вулканической деятельности за миллионы лет создания того вида, который предстанет перед вашим взором. То величие природы и огромной силы, построившие практически с нуля в Атлантическом океане землю, где многообразный климат овладевает каждым уголком этой почвы. Причудливые формы горных строений, застывшая лава над стелющимися плотными облаками, вырисовывающиеся формы о. Тенерифе и образовавшейся 150000 лет назад кальдеры. И конечно соседние Канарские острова, отчетливо проглядываясь вдалеке.\r\n\r\nВсе сказанное манит увидеть воочию, почувствовать самому звенящую тишину многовековых мест. Экскурсия по канатной дороге и красочные виды, оставят у вас немало приятных воспоминаний на долгие годы.', , '6.jpg', '');
INSERT INTO `taskBook` (`id`, `name`, `email`, `status`, `task`, `image`, `image_name`, `edit`) VALUES
(7, 'Андрей', 'andrei@rambler.ru', 0, 'Обязательно поехать.\r\nБольшой Барьерный риф протянулся вдоль восточного побережья Австралии более чем на 2000 км на юг от Папуа-Новой Гвинеи. Его ширина в северной части достигает 2 км, в южной ?150 км. Большой Барьерный риф является уникальной и самой большой структурой на планете, созданной живыми организмами. Из 350 видов кораллов, известных в мире, здесь обитают 340. В состав Большой Барьерный рифа входят более 100 островов, покрытых тропическими лесами, и еще около 600 островов без растительности. Многие острова окружены собственными рифами. Большее количество коралловых образований скрывается под водой во время приливов. Общая площадь Большого Барьерного рифа — 348,7 тыс. км2, что превышает площадь Британских островов. До настоящего времени есть острова, на которые не ступала нога человека. Подводный мир вокруг островов рифа поражает своими красками и разнообразием живых форм. Здесь можно увидеть ярких разноцветных рыбок и морских животных среди коралловых садов пурпурного, розового, лилового, зеленого, коричневого, голубого и желтого цветов. На островах рифа раскинулись километры великолепных «золотых» пляжей. Для туристов организованы увлекательные маршруты как на внешний край рифа, где начинается Тихий океан, так и вглубь островов. Гости могут полетать на воздушных шарах или покататься на лошадях по песчаным дюнам, искупаться в водопадах тропических лесов, спасаясь от жары, или зайти в гости к аборигенам. Для защиты флоры и фауны побережий, а также мелководий уникального рифа в 1979 г. австралийским правительством был образован морской национальный парк площадью более 5 млн. га. Позднее, в 1981 г. он был включен в список Всемирного наследия ЮНЕСКО. Первые люди в Австралии появились около 45 тыс. лет назад, Это были предки современных австралийских аборигенов, перебравшихся сюда из Юго-Восточной Азии. Некоторые ученые полагают, что многие племена имеют африканское происхождение. Аборигены были охотниками и собирателями. Их культура основана на поклонении земле. В 1606 г. Австралию открыл голландский капитан Биллем Янц. В XVII в. голландцы составили карты западного и северного побережий, но осваивать эти земли не стали. В 1770 г. Джеймс Кук открыл восточную часть Австралии, которую назвал Новым Южным Уэльсом и провозгласил ее собственностью Британской короны.', , '7.jpg', '');
